import React from "react";
import { Link } from "react-router-dom";
import { Box, ListItemIcon, Typography } from "@mui/material";
import { useState, useEffect } from "react";

function Drone() {
  return (
    <div //parent div style of ALL ROWS
      style={{
        display: "grid",
        gridTemplateRows: "repeat(3, minmax(100px, auto))",
        gridGap: "10px",
        margin: "0 auto",
        maxWidth: "90%",
      }}
    >
      <div // Parent div for row 1 start here
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(3, 1fr)", // add this property to create 3 evenly spaced boxes
          gridGap: "10px",
          height: "200px",
          justifyContent: "space-between", // add this property to space the boxes evenly
        }}
      >
        <div style={{ backgroundColor: "transparent" }}>Box 1</div>

        <div style={{ backgroundColor: "black" }}>Box 2</div>
        <div style={{ backgroundColor: "black" }}>Box 3</div>
      </div>
      {/* parent div END for row 1 above */}

      {/* ////////////////////////////row 2 start/////////////////////////////////////////////// */}

      <div //parent div style for row 2
        style={{
          backgroundColor: "#181818",
          height: "400px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div //box surrounding both "drone" box and image of drone box
          style={{
            backgroundColor: "#181818",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <div //box surround "drone"
            style={{
              backgroundColor: "#181818",
              width: "50px",
              height: "20px",
              lineHeight: "20px",
              borderRadius: "5px",
              marginBottom: "10px",
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            Drone
          </div>
          <img src="../../assets/drone_diagram_large.svg" alt="Drone Image" />
        </div>
      </div>
      {/* parent style for row 2 ends above */}

      {/* /////////////////////////////row 3 start////////////////////////////////////////////// */}

      <div //parent style for ROW 3
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(3, 1fr)",
          gridGap: "10px",
          backgroundColor: "#181818",
          height: "200px",
        }}
      >
        <div //main outside for box 1
          style={{
            backgroundColor: "#181818",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div //box around text
            style={{
              backgroundColor: "transparent",
              width: "150px",
              height: "80px",
              borderRadius: "5px",
              position: "relative",
            }}
          >
            <div //styling the text
              style={{
                position: "absolute",
                top: 0,
                left: 0,
                right: 0,
                bottom: 0,
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
                alignItems: "center",
                textAlign: "center",
              }}
            >
              <div style={{ color: "#e8e8e8" }}>Last flight completed:</div>
              <div style={{ color: "#00e1b4" }}>May 7, 2021 1:28pm</div>
            </div>
          </div>
        </div>
        <div //main outside for box 2
          style={{
            backgroundColor: "#181818",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div //box around text
            style={{
              backgroundColor: "transparent",
              width: "150px",
              height: "80px",
              borderRadius: "5px",
              position: "relative",
            }}
          >
            <div //styling the text
              style={{
                position: "absolute",
                top: 0,
                left: 0,
                right: 0,
                bottom: 0,
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
                alignItems: "center",
                textAlign: "center",
              }}
            >
              <div style={{ color: "#e8e8e8" }}>Status:</div>
              <div style={{ color: "#00e1b4" }}>Charging</div>
            </div>
          </div>
        </div>
        <div //main outside box for box 3
          style={{
            backgroundColor: "#181818",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div //box around text
            style={{
              backgroundColor: "transparent",
              width: "150px",
              height: "80px",
              borderRadius: "5px",
              position: "relative",
            }}
          >
            <div //styling the text
              style={{
                position: "absolute",
                top: 0,
                left: 0,
                right: 0,
                bottom: 0,
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
                alignItems: "center",
                textAlign: "center",
              }}
            >
              <div style={{ color: "#e8e8e8" }}>Battery Charge:</div>
              <div style={{ color: "#00e1b4" }}>38.41%</div>
            </div>
          </div>
        </div>
      </div>
      {/* parent ends for row 3 above */}

      {/* ////////////////////////////////end of page//////////////////////// */}
    </div>
    // END OF PARENT DIV OF ALL ROWS ABOVE
  );
}

export default Drone;
